import React from 'react';
import ExpenseItem from './ExpenseItem';

function Expenses() {
	const ExpenseData = [
		{
			date: new Date(2020, 7, 14),
			item: 'Toilet Papper',
			cost: '99',
		},
		{
			date: new Date(2021, 2, 12),
			item: 'New TV',
			cost: '49999',
		},
		{
			date: new Date(2022, 2, 28),
			item: 'CAr Insurance',
			cost: '6000',
		},
		{
			date: new Date(2021, 5, 12),
			item: 'New Desk',
			cost: '3000',
		},
	];
	return (
		<div>
			<h1>{ExpenseData[0].date.toLocaleString}</h1>
			{ExpenseData.map((item) => {
				return (
					<ExpenseItem
						date={item.date}
						item={item.item}
						cost={item.cost}
					/>
				);
			})}
		</div>
	);
}

export default Expenses;
